import psutil
import os
import subprocess
import pygame
import base64
from time import sleep
from io import BytesIO


def audio():  # 音频(base64)
    b64 = b''
    return b64


def play_audio():  # 播放音频
    pygame.mixer.init()
    pygame.mixer.music.load(BytesIO(base64.b64decode(audio())))
    pygame.mixer.music.set_volume(1)
    pygame.mixer.music.play()


def run_command(command):  # 运行shell指令
    try:
        subprocess.run(command, shell=True, check=True, stdin=subprocess.DEVNULL, stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
    except subprocess.CalledProcessError:
        pass


def delete(process_info):  # 删除游戏
    psutil.Process(process_info[0]).terminate()
    while True:
        try:
            psutil.Process(process_info[0])
        except psutil.NoSuchProcess:
            break
        sleep(1)
    path = os.path.dirname(process_info[2])
    run_command(f'del /f /q /s "{path}"')
    run_command(f'rd /s /q "{path}"')


def main_app():  # 主程序
    name = 'YuanShen'
    process_info = []
    try:
        for pid in psutil.pids():
            process = psutil.Process(pid)
            if name in process.name():
                process_info = [pid, process.name(), process.exe()]
    except psutil.NoSuchProcess:
        pass
    if len(process_info) != 0:
        play_audio()
        while pygame.mixer.music.get_busy():
            try:
                psutil.Process(process_info[0])
            except psutil.NoSuchProcess:
                break
            sleep(1)
        delete(process_info)


if __name__ == '__main__':  # 启动程序
    while True:
        main_app()
        sleep(1)
